INSERT INTO `v1_283f346626f61a5f086ed6f86ac1541c66c17e8bd5f6d07dae571ce51ea5f6ad` VALUES (24, "リン", 0.0, 1, 102601, 0.0, "2030/12/17 14:59:59", 1, "2020/04/30 12:00:00", 10040, 24001, 0, 0.0, "あたしだって\nやるときはやるよ！");
INSERT INTO `v1_283f346626f61a5f086ed6f86ac1541c66c17e8bd5f6d07dae571ce51ea5f6ad` VALUES (24, "リン", 0.0, 1, 102601, 0.0, "2030/12/17 14:59:59", 1, "2020/04/30 12:00:00", 10040, 24002, 1, 0.0, "ふぅ…\nこれであたしの仕事は\n終わりだね");
INSERT INTO `v1_283f346626f61a5f086ed6f86ac1541c66c17e8bd5f6d07dae571ce51ea5f6ad` VALUES (24, "リン", 0.0, 1, 102601, 0.0, "2030/12/17 14:59:59", 1, "2020/04/30 12:00:00", 10040, 24003, 2, 0.0, "終わった終わった\n一人でもなんとか\nなるもんだね");
INSERT INTO `v1_283f346626f61a5f086ed6f86ac1541c66c17e8bd5f6d07dae571ce51ea5f6ad` VALUES (24, "リン", 0.0, 2, 102601, 0.0, "2030/12/17 14:59:59", 2, "2020/04/30 12:00:00", 10040, 24004, 3, 0.0, "やったね！\nこれでようやく\nサボれるよ…");
INSERT INTO `v1_283f346626f61a5f086ed6f86ac1541c66c17e8bd5f6d07dae571ce51ea5f6ad` VALUES (24, "リン", 0.0, 1, 102601, 0.0, "2030/12/17 14:59:59", 1, "2020/04/30 12:00:00", 10040, 24005, 4, 0.0, "チーズが欲しいなら\nきちんと働いて\n買いに来なよ");
INSERT INTO `v1_283f346626f61a5f086ed6f86ac1541c66c17e8bd5f6d07dae571ce51ea5f6ad` VALUES (24, "リン", 0.0, 2, 102601, 0.0, "2030/12/17 14:59:59", 2, "2020/04/30 12:00:00", 10040, 24006, 5, 0.0, "あたしを敵に回した\n恐ろしさ\n思い知ったか！");
INSERT INTO `v1_283f346626f61a5f086ed6f86ac1541c66c17e8bd5f6d07dae571ce51ea5f6ad` VALUES (24, "リン", 0.0, 2, 102601, 0.0, "2030/12/17 14:59:59", 2, "2020/04/30 12:00:00", 10040, 24007, 6, 0.0, "あたしも意外と\nやるもんでしょ？");
INSERT INTO `v1_283f346626f61a5f086ed6f86ac1541c66c17e8bd5f6d07dae571ce51ea5f6ad` VALUES (24, "リン", 0.0, 4, 102601, 0.0, "2030/12/17 14:59:59", 4, "2020/04/30 12:00:00", 10040, 24008, 7, 0.0, "疲れた…\nねずみの逃げ足\n速すぎるよ…");
INSERT INTO `v1_283f346626f61a5f086ed6f86ac1541c66c17e8bd5f6d07dae571ce51ea5f6ad` VALUES (24, "リン", 0.0, 4, 102601, 0.0, "2030/12/17 14:59:59", 4, "2020/04/30 12:00:00", 10040, 24009, 8, 0.0, "このままじゃ\nまっひ～に\n叱られちゃうよ");
INSERT INTO `v1_283f346626f61a5f086ed6f86ac1541c66c17e8bd5f6d07dae571ce51ea5f6ad` VALUES (24, "リン", 0.0, 4, 102601, 0.0, "2030/12/17 14:59:59", 4, "2020/04/30 12:00:00", 10040, 24010, 9, 0.0, "まじめに\nやったんだけどな…\n悔しいな～");
INSERT INTO `v1_283f346626f61a5f086ed6f86ac1541c66c17e8bd5f6d07dae571ce51ea5f6ad` VALUES (24, "リン", 0.0, 4, 102601, 0.0, "2030/12/17 14:59:59", 4, "2020/04/30 12:00:00", 10040, 24011, 10, 0.0, "やられた…\nねずみって意外と\nてごわいね");
INSERT INTO `v1_283f346626f61a5f086ed6f86ac1541c66c17e8bd5f6d07dae571ce51ea5f6ad` VALUES (24, "リン", 0.0, 4, 102601, 0.0, "2030/12/17 14:59:59", 4, "2020/04/30 12:00:00", 10040, 24012, 11, 0.0, "おのれ～\nあたしのチーズを\n盗みやがって～！");
INSERT INTO `v1_283f346626f61a5f086ed6f86ac1541c66c17e8bd5f6d07dae571ce51ea5f6ad` VALUES (24, "リン", 1.81, 1, 102601, 0.0, "2030/12/17 14:59:59", 4, "2020/04/30 12:00:00", 10040, 24013, 12, 0.0, "疲れた…\nけど、次こそは\n守り抜くよ…");
